import React, { useEffect } from "react";
import AOS from 'aos';
import 'aos/dist/aos.css';
import '../Components/Styles/Contact.css';
function Contact() {
    useEffect(() => {
        AOS.init({
            duration: 3000
        })

    }, [])
    return (
        
            <div className="container-fluid">
                <div className="row">
                    <div className="col-sm-12 img6">
    <div className="box1 rgba6 pt-5" data-aos="zoom-in" data-aos-duration="3000">
        <div className="col-sm-6">
    <span className="display-1 text-light ms-5" style={{ "textShadow": "2px 3px 9px black", "fontFamily": " impact"  }}>CONTENT OS
</span><br />
    <span className=" text-light fs-3 ms-5" style={{"textShadow": "0px 0px 4px red"}} >

<br />
                              <br />          
                     </span>
                            </div>
<div className="row">
    <div className="col-sm-6">
        <center>
        <button className="btn btn-danger">Home</button>
        &nbsp;   &nbsp;
                        &nbsp;   &nbsp;
        <button className="btn btn-danger">CONTENT</button>
        </center>
        </div>
</div>    
    </div>
                    </div>
                </div>
                <br/>

              
                    </div>
          
    )
};
export default Contact;
